const Cunt =()=>{

const [ a ,b] = useState(0)

const inc =()=>{
b(a +1)

}

    return(<> 
    
    <h1>{a}</h1>
    <button onClick={inc}>Increment </button>
    <button>Decreament</button>
    
    </>)
} ;
export default Cunt ;
